import src.util

class VDOM_progressbar(VDOM_object):

	def render(self, parent, contents=""):
		css1 = "position:absolute;overflow:hidden;position:relative;left:%spx;top:%spx;" % ( self.left, self.top )
		css2 = "position:absolute;left:0;top:0;"

		if self.visible == "0":
			css1 += "display:none;"

		image1 = src.util.id.id2link1(self.image1)
		image2 = src.util.id.id2link1(self.image2)

		if self.skin == "1":
			css1 += 'width:250px;height:26px;background:url("/361b54a5-a944-8020-ff02-e5d396cd8d04.res");'
			css2 += 'height:26px;background:url("/225ef69a-9a1c-e0e8-b240-4174ea3a4881.res");'
		else:
			css1 += 'width:%spx;height:%spx;background:url("%s");' % ( self.width, self.height, image1 )
			css2 += 'height:%spx;background:url("%s");' % ( self.height, image2 )

		min = int(self.min)
		max = int(self.max)
		val = int(self.value)
		if max < min:
			max = min
		if val < min:
			val = min
		if val > max:
			val = max
		val = (val * 100) / (max - min)

		css2 += "width:%s%%;" % ( val )

		id = 'o_' + (self.id).replace('-', '_')

		result = u"""<div id="%(id)s" style='%(css1)s' min="%(min)s" max="%(max)s"><div style='%(css2)s'></div></div>"""%{
			"id": id, "css1": css1, "css2": css2, "min": min, "max": max }

		return VDOM_object.render(self, parent, contents=result)

	def wysiwyg(self, parent, contents=""):

		image_id1 = self.image1
		image_id2 = self.image2
		image_width = outer_width = int(self.width)
		image_height = outer_height = int(self.height)

		if "" == image_id1:
			image_id1 = "361b54a5-a944-8020-ff02-e5d396cd8d04"
			image_id2 = "225ef69a-9a1c-e0e8-b240-4174ea3a4881"
			image_width = outer_width = 250
			image_height = outer_height = 26

		min = int(self.min)
		max = int(self.max)
		val = int(self.value)
		if max < min:
			max = min
		if val < min:
			val = min
		if val > max:
			val = max
		val = (val * 100) / (max - min)
		valw = (int(image_width) * val) / 100

		result="""<container id="%(id)s" visible="%(visible)s" zindex="%(z)s" hierarchy="%(h)s" order="%(o)s" top="%(top)s" left="%(left)s" width="%(width)s" height="%(height)s">
				<svg>
					<image x="0" y="0" width="%(width)s" height="%(height)s" href="#Res(%(image1)s)" />
					<image x="0" y="0" width="%(val)s" height="%(height)s" href="#Res(%(image2)s)" />
				</svg>
			</container>"""%{
				"id": self.id, "visible": self.visible, "z": self.zindex, "h": self.hierarchy, "o": self.order,
				"top": self.top, "left": self.left, "width": outer_width, "height": outer_height,
				"image1": image_id1, "image2": image_id2, "val": valw  }

		return VDOM_object.wysiwyg(self, parent, contents=result)

